script: |
  super -f text -I q3525.spq | sort > q3525.out

inputs:
  - name: q3525.spq
    data: |
      SELECT ALL col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 * + col0 IS NOT NULL AND col1 - - col2 BETWEEN - col0 AND NULL;
  - name: tab1

outputs:
  - name: q3525.out
    data: |
